import React from "react";
import Product from "../../products/product.component";

import "./popularProducts.scss";

class PopularProducts extends React.Component {
  render() {
    return (
      <section className="grid__main">
        <div className="container">
          <h1>Popular Products</h1>
          <div className="product-grid">
            <Product imageUrl={'https://images.unsplash.com/photo-1499713907394-43c9d094ac2e?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1036&q=80'} price={'10'} name={''} />
          </div>
        </div>
      </section>
    );
  }
}
export default PopularProducts;
